import React, { useState } from "react";
import { useHistory } from "react-router-dom";
import {
  Container,
  ConteudoForm,
  Form,
  Label,
  Input,
  BotaoAcao,
  AlertSuccess,
  AlertDanger,
  Titulo,
  ConteudoTitulo,
} from "./styles";

export default function CadastrarUsuario() {
  const history = useHistory();
  const [usuario, setUsuario] = useState({
    nome: "",
    email: "",
    senha: "",
    confirmar_senha: "",
  });

  const [status, setStatus] = useState({
    type: "",
    mensagem: "",
  });

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (
      !usuario.nome ||
      !usuario.email ||
      !usuario.senha ||
      !usuario.confirmar_senha
    ) {
      setStatus({
        type: "erro",
        mensagem: "Preencha todos os campos!",
      });
      return;
    }

    if (usuario.senha !== usuario.confirmar_senha) {
      setStatus({
        type: "erro",
        mensagem: "As senhas não conferem!",
      });
      return;
    }

    try {
      const response = await fetch(
        "http://localhost:8000/controllers/usuarios.php",
        {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            nome: usuario.nome,
            email: usuario.email,
            senha: usuario.senha,
          }),
        }
      );

      const data = await response.json();

      if (data.erro) {
        throw new Error(data.mensagem);
      }

      setStatus({
        type: "success",
        mensagem: "Usuário cadastrado com sucesso!",
      });

      setTimeout(() => {
        history.push("/login");
      }, 2000);
    } catch (err) {
      setStatus({
        type: "erro",
        mensagem: err.message,
      });
    }
  };

  return (
    <Container>
      <ConteudoTitulo>
        <Titulo>Cadastrar Usuário</Titulo>
        <BotaoAcao onClick={() => history.goBack()}>Voltar</BotaoAcao>
      </ConteudoTitulo>

      <ConteudoForm>
        {status.type === "erro" && <AlertDanger>{status.mensagem}</AlertDanger>}
        {status.type === "success" && (
          <AlertSuccess>{status.mensagem}</AlertSuccess>
        )}
        <Form onSubmit={handleSubmit}>
          <div>
            <Label>Nome</Label>
            <Input
              type="text"
              value={usuario.nome}
              onChange={(e) => setUsuario({ ...usuario, nome: e.target.value })}
            />
          </div>
          <div>
            <Label>Email</Label>
            <Input
              type="email"
              value={usuario.email}
              onChange={(e) =>
                setUsuario({ ...usuario, email: e.target.value })
              }
            />
          </div>
          <div>
            <Label>Senha</Label>
            <Input
              type="password"
              value={usuario.senha}
              onChange={(e) =>
                setUsuario({ ...usuario, senha: e.target.value })
              }
            />
          </div>
          <div>
            <Label>Confirmar Senha</Label>
            <Input
              type="password"
              value={usuario.confirmar_senha}
              onChange={(e) =>
                setUsuario({ ...usuario, confirmar_senha: e.target.value })
              }
            />
          </div>
          <div className="button-container">
            <BotaoAcao type="submit">Cadastrar</BotaoAcao>
          </div>
        </Form>
      </ConteudoForm>
    </Container>
  );
}
